webpackJsonp([0xd09e40623ba4],{395:function(e,A){e.exports={data:{markdownRemark:{id:"/Users/cgreen/Documents/Projects üí© üëª /codeSquawk/content/posts/2018-01-29--lets-stream/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-3a163.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.67356654936866%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Photo by John Schnobrich on Unsplash"\n        title=""\n        src="/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-893a4.jpg"\n        srcset="/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-bbf57.jpg 200w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-260b8.jpg 400w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-893a4.jpg 800w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-25965.jpg 1200w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-e54c8.jpg 1600w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-7c0ed.jpg 2400w,\n/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-3a163.jpg 4831w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Recently I came to the conclusion that I needed to practice specific development strategies more. Most of what I am struggling with is in data structure work, styling, design, and documentation. And I am taking classes specifically to learn the basic data manipulation. However I still need to work on everything else.</p>\n<blockquote>\n<p>That‚Äôs where you come in.</p>\n</blockquote>\n<p>I am going to begin programming on a <a href="https://twitch.tv/ecleptic">Twitch</a> stream. If writing my thoughts out on a blog form is a good way to learn, then wouldn‚Äôt real-time feedback while programming be useful? Actually I don‚Äôt know. However I do realize that it can be good to speak out loud my problems and thought-processes.</p>\n<p>I plan on finding a steady schedule soon, however for now I will program when it fits the schedule and then upload them to <a href="https://www.youtube.com/channel/UCRUMgB4tI3vuVfZMYyz0EBQ">Youtube</a> where I will keep my videos for all posterity. <em>oh boy</em></p>\n<p>Some projects I‚Äôd like to work on are:</p>\n<ul>\n<li class="task-list-item"><input type="checkbox" disabled> An interval timer PWA<sup>*</sup></li>\n<li class="task-list-item"><input type="checkbox" disabled> An image gallery supporting image upload to AWS or some other CMS specifically for images</li>\n<li class="task-list-item"><input type="checkbox" disabled> Maybe a nice note-taking app that lets you link to other notes and supports a file/folder structure <sub>(using tags?)</sub></li>\n<li class="task-list-item"><input type="checkbox" disabled> A music player connected to spotify/google/apple music APIs which would let groups of people add songs to a queue</li>\n<li class="task-list-item"><input type="checkbox" disabled> Something with a user side and an admin panel</li>\n<li class="task-list-item"><input type="checkbox" disabled> Something in React Native</li>\n<li class="task-list-item"><input type="checkbox" disabled> A jackbox-type game</li>\n</ul>\n<p>That‚Äôs a lot, and I may <em>never</em> get to all of them, but they‚Äôll be fun to make and Every one of them I will learn something new.</p>\n<p>First I‚Äôm going to start easy with the interval timer.</p>\n<p>So come join me on <a href="https://twitch.tv/ecleptic">Twitch</a> and <a href="https://www.youtube.com/channel/UCRUMgB4tI3vuVfZMYyz0EBQ">Youtube</a>!! üòÅ</p>\n<p>See you there!</p>\n<p>Cameron</p>\n<br>\n<br>\n<br>\n<p><sup>*</sup> <sub> PWA is a <a href="https://developers.google.com/web/fundamentals/codelabs/your-first-pwapp/">Progressive Web App</a></sub></p>',frontmatter:{title:"Let's Stream",subTitle:"Doing something is the first step to learning it",date:"January 29, 2018",cover:{childImageSharp:{resize:{src:"/static/john-schnobrich-520023-16e506553b0b159f9e2804476ce6fae9-ada8c.jpg"}}}}}},pathContext:{path:"/lets-stream/"}}}});
